import React from 'react';
import styled from 'styled-components';

const InputText = styled.input`
    border: 2px solid #000;
    border-radius: 5px;
    padding: 15px;
    font-size: 17px;
    width: 300px;
`;

function SearchBox() {
    
    return (
        <InputText />
    );
};

export default SearchBox;
